import React from 'react';
import './RocketStyle.css'; // Assuming you have the RocketStyle.css file in the same directory as this component
import rocketImage from '.public/rocket.png'; // Assuming the rocket image is in the same directory as this component

export default function Home() {
  // Function to create stars
  function stars() {
    let count = 20;
    let starsElements = [];
    let i = 0;
    while (i < count) {
      let star = (
        <i
          key={i}
          style={{
            left: Math.floor(Math.random() * window.innerWidth) + 'px',
            width: '1px',
            height: 50 + Math.random() * 100 + 'px',
            animationDuration: Math.random() + 's',
          }}
        ></i>
      );
      starsElements.push(star);
      i++;
    }
    return starsElements;
  }

  return (
    <div>
      <h1>Home</h1>
      <div className="scene">
        <div className="rocket">
          <img src={rocketImage} alt="Rocket" />
        </div>
        {stars()} {/* Call the stars function here to add the stars */}
      </div>
    </div>
  );
}
